<meta charset="UTF-8">
<script>
    function mostra(texto) {
        document.write(texto);
        document.write("<br>");
    }

    var numInicial = 30;
    var numFinal = 40;

    while (numInicial <= numFinal) {
        if (numInicial != 33 && numInicial != 37) {
            mostra(numInicial);
        }
        numInicial += 1;
    }
</script>
